import axios from 'axios';
import React from 'react'
import { Link, useLocation } from 'react-router-dom'

function Navbar() {
    const location = useLocation();
    const handleLogout = () => {
        try {
            const response = axios.post('http://localhost:8000/api/appointment/logout',{ withCredentials: true });
            console.log(response.data)
        } catch (error) {
            console.log(error)
        }
    }

    return (
        <div className=' bg-gradient-to-tr from-blue-600 to-blue-400 h-[33vh]'>
            <div className=' py-5 text-center font-semibold text-white text-xl'>
                <h1>{location.pathname === '/login' ? 'Please Login' : 'Please Register'}</h1>
            </div>
            <div className='flex justify-around text-white text-xl font-semibold'>
                <Link to="/login">Login</Link>
                <Link to="/">Register</Link>
                <button onClick={handleLogout}>Logout</button>
            </div>
        </div>
    )
}

export default Navbar
